import axios from "axios";

var entityService = {
    endpoint: "https://api.remotebootcamp.dev/api/entities/",
    entity: "Machines",

}

entityService.new = (payload) => {
    const config = {
        method: "POST",
        url: entityService.endpoint + entityService.entity,
        data: payload,
        crossdomain: true,
        headers: { "Content-Type": "application/json" }
    }
    return axios(config);
}

export default entityService;
